#!/api/Ext.ux.grid.filter.DateFilter-method-setValue' cl***REMOVED***='name expandable'>setValue</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Object\" rel=\"Object\" cl***REMOVED***=\"docCl***REMOVED***\">Object</a> value, <a href=\"#!/api/Boolean\" rel=\"Boolean\" cl***REMOVED***=\"docCl***REMOVED***\">Boolean</a> preserve</span> )<strong cl***REMOVED***='private signature'>private</strong></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Template method that is to set the value of the filter. ...</div><div cl***REMOVED***='long'><p>Template method that is to set the value of the filter.</p>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>value</span> : <a href=\"#!/api/Object\" rel=\"Object\" cl***REMOVED***=\"docCl***REMOVED***\">Object</a><div cl***REMOVED***='sub-desc'><p>The value to set the filter</p>\n</div></li><li><span cl***REMOVED***='pre'>preserve</span> : <a href=\"#!/api/Boolean\" rel=\"Boolean\" cl***REMOVED***=\"docCl***REMOVED***\">Boolean</a><div cl***REMOVED***='sub-desc'><p>true to preserve the checked status\nof the other fields.  Defaults to false, unchecking the\nother fields</p>\n</div></li></ul><p>Overrides: <a href='#!/api/Ext.ux.grid.filter.Filter-method-setValue' rel='Ext.ux.grid.filter.Filter-method-setValue' cl***REMOVED***='docCl***REMOVED***'>Ext.ux.grid.filter.Filter.setValue</a></p></div></div></div><div id='method-statics' cl***REMOVED***='member  inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' cl***REMOVED***='defined-in docCl***REMOVED***'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-statics' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-statics' cl***REMOVED***='name expandable'>statics</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Ext.Cl***REMOVED***\" rel=\"Ext.Cl***REMOVED***\" cl***REMOVED***=\"docCl***REMOVED***\">Ext.Cl***REMOVED***</a><strong cl***REMOVED***='protected signature'>protected</strong></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Get the reference to the cl***REMOVED*** from which this object was instantiated. ...</div><div cl***REMOVED***='long'><p>Get the reference to the cl***REMOVED*** from which this object was instantiated. Note that unlike <a href=\"#!/api/Ext.Base-property-self\" rel=\"Ext.Base-property-self\" cl***REMOVED***=\"docCl***REMOVED***\">self</a>,\n<code>this.statics()</code> is scope-independent and it always returns the cl***REMOVED*** from which it was called, regardless of what\n<code>this</code> points to during run-time</p>\n\n<pre><code><a href=\"#!/api/Ext-method-define\" rel=\"Ext-method-define\" cl***REMOVED***=\"docCl***REMOVED***\">Ext.define</a>('My.Cat', {\n    statics: {\n        totalCreated: 0,\n        speciesName: 'Cat' // My.Cat.speciesName = 'Cat'\n    },\n\n    constructor: function() {\n        var statics = this.statics();\n\n        alert(statics.speciesName);     // always equals to 'Cat' no matter what 'this' refers to\n                                        // equivalent to: My.Cat.speciesName\n\n        alert(this.self.speciesName);   // dependent on 'this'\n\n        statics.totalCreated++;\n    },\n\n    clone: function() {\n        var cloned = new this.self;                      // dependent on 'this'\n\n        cloned.groupName = this.statics().speciesName;   // equivalent to: My.Cat.speciesName\n\n        return cloned;\n    }\n});\n\n\n<a href=\"#!/api/Ext-method-define\" rel=\"Ext-method-define\" cl***REMOVED***=\"docCl***REMOVED***\">Ext.define</a>('My.SnowLeopard', {\n    extend: 'My.Cat',\n\n    statics: {\n        speciesName: 'Snow Leopard'     // My.SnowLeopard.speciesName = 'Snow Leopard'\n    },\n\n    constructor: function() {\n        this.callParent();\n    }\n});\n\nvar cat = new My.Cat();                 // alerts 'Cat', then alerts 'Cat'\n\nvar snowLeopard = new My.SnowLeopard(); // alerts 'Cat', then alerts 'Snow Leopard'\n\nvar clone = snowLeopard.clone();\nalert(<a href=\"#!/api/Ext-method-getCl***REMOVED***Name\" rel=\"Ext-method-getCl***REMOVED***Name\" cl***REMOVED***=\"docCl***REMOVED***\">Ext.getCl***REMOVED***Name</a>(clone));         // alerts 'My.SnowLeopard'\nalert(clone.groupName);                 // alerts 'Cat'\n\nalert(My.Cat.totalCreated);             // alerts 3\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Ext.Cl***REMOVED***\" rel=\"Ext.Cl***REMOVED***\" cl***REMOVED***=\"docCl***REMOVED***\">Ext.Cl***REMOVED***</a></span><div cl***REMOVED***='sub-desc'>\n</div></li></ul></div></div></div><div id='method-suspendEvents' cl***REMOVED***='member  inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><a href='#!/api/Ext.util.Observable' rel='Ext.util.Observable' cl***REMOVED***='defined-in docCl***REMOVED***'>Ext.util.Observable</a><br/><a href='source/Observable.html#Ext-util-Observable-method-suspendEvents' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Ext.util.Observable-method-suspendEvents' cl***REMOVED***='name expandable'>suspendEvents</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Boolean\" rel=\"Boolean\" cl***REMOVED***=\"docCl***REMOVED***\">Boolean</a> queueSuspended</span> )</div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Suspends the firing of all events. ...</div><div cl***REMOVED***='long'><p>Suspends the firing of all events. (see <a href=\"#!/api/Ext.util.Observable-method-resumeEvents\" rel=\"Ext.util.Observable-method-resumeEvents\" cl***REMOVED***=\"docCl***REMOVED***\">resumeEvents</a>)</p>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>queueSuspended</span> : <a href=\"#!/api/Boolean\" rel=\"Boolean\" cl***REMOVED***=\"docCl***REMOVED***\">Boolean</a><div cl***REMOVED***='sub-desc'><p>P***REMOVED*** as true to queue up suspended events to be fired\nafter the <a href=\"#!/api/Ext.util.Observable-method-resumeEvents\" rel=\"Ext.util.Observable-method-resumeEvents\" cl***REMOVED***=\"docCl***REMOVED***\">resumeEvents</a> call instead of discarding all suspended events.</p>\n</div></li></ul></div></div></div><div id='method-un' cl***REMOVED***='member  inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><a href='#!/api/Ext.util.Observable' rel='Ext.util.Observable' cl***REMOVED***='defined-in docCl***REMOVED***'>Ext.util.Observable</a><br/><a href='source/Observable.html#Ext-util-Observable-method-un' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Ext.util.Observable-method-un' cl***REMOVED***='name expandable'>un</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a> eventName, <a href=\"#!/api/Function\" rel=\"Function\" cl***REMOVED***=\"docCl***REMOVED***\">Function</a> fn, [<a href=\"#!/api/Object\" rel=\"Object\" cl***REMOVED***=\"docCl***REMOVED***\">Object</a> scope]</span> )</div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Shorthand for removeListener. ...</div><div cl***REMOVED***='long'><p>Shorthand for <a href=\"#!/api/Ext.util.Observable-method-removeListener\" rel=\"Ext.util.Observable-method-removeListener\" cl***REMOVED***=\"docCl***REMOVED***\">removeListener</a>.</p>\n\n<p>Removes an event handler.</p>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>eventName</span> : <a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a><div cl***REMOVED***='sub-desc'><p>The type of event the handler was ***REMOVED***ociated with.</p>\n\n</div></li><li><span cl***REMOVED***='pre'>fn</span> : <a href=\"#!/api/Function\" rel=\"Function\" cl***REMOVED***=\"docCl***REMOVED***\">Function</a><div cl***REMOVED***='sub-desc'><p>The handler to remove. <strong>This must be a reference to the function p***REMOVED***ed into the\n<a href=\"#!/api/Ext.util.Observable-method-addListener\" rel=\"Ext.util.Observable-method-addListener\" cl***REMOVED***=\"docCl***REMOVED***\">addListener</a> call.</strong></p>\n\n</div></li><li><span cl***REMOVED***='pre'>scope</span> : <a href=\"#!/api/Object\" rel=\"Object\" cl***REMOVED***=\"docCl***REMOVED***\">Object</a> (optional)<div cl***REMOVED***='sub-desc'><p>The scope originally specified for the handler. It must be the same as the\nscope argument specified in the original call to <a href=\"#!/api/Ext.util.Observable-method-addListener\" rel=\"Ext.util.Observable-method-addListener\" cl***REMOVED***=\"docCl***REMOVED***\">addListener</a> or the listener will not be removed.</p>\n\n</div></li></ul></div></div></div><div id='method-validateRecord' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Ext.ux.grid.filter.DateFilter'>Ext.ux.grid.filter.DateFilter</span><br/><a href='source/DateFilter.html#Ext-ux-grid-filter-DateFilter-method-validateRecord' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Ext.ux.grid.filter.DateFilter-method-validateRecord' cl***REMOVED***='name expandable'>validateRecord</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Ext.data.Model\" rel=\"Ext.data.Model\" cl***REMOVED***=\"docCl***REMOVED***\">Ext.data.Record</a> record</span> ) : <a href=\"#!/api/Boolean\" rel=\"Boolean\" cl***REMOVED***=\"docCl***REMOVED***\">Boolean</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Template method that is to validate the provided Ext.data.Record\nagainst the filters configuration. ...</div><div cl***REM